void reset_mazes(){
        int i,j,m,n;
        for(i=0;i<320;i++){
            for(j=0;j<240;j++){
                    pixel_maze[j][i]=pixel_maze_back[j][i];
                }
            }
        for(m=0;m<21;m++){
            for(n=0;n<20;n++){
                    maze[n][m]=maze_back[n][m];
                }
            }
    }

void wait_for_vsync(){
	volatile int * pixel_ctrl_ptr = (int *)0xFF203020;
	register int status;
	*pixel_ctrl_ptr=1;
	status = *(pixel_ctrl_ptr+3);
	while((status &0x01)!=0){
		status = *(pixel_ctrl_ptr+3);
	}
}

void clear_screen(){
    int x;
    int y;
    for (y = 0; y<RESOLUTION_Y;y++){
        for (x=0;x<RESOLUTION_X;x++){
        plot_pixel(x,y,0x0000);
        }
    }
}

void plot_pixel(int x, int y, short int line_color){
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}

